def UNIMY():
    def fillFix(string, length = 8, filler = '0'):
        needToFill = length-len(str(string))
        return str(filler)*int(needToFill)+str(string)

    uniEncoded = ''

    uniRanges = [
        {'start':   128512,    
         'end':     128512+80},
         
        {'start':   128640,    
         'end':     128640+128},
         
        {'start':   128896,    
         'end':     128896+128},
         
        {'start':   129280,    
         'end':     129280+256}
    ]

    for nowRange in uniRanges:
        for item in range(nowRange['start'],nowRange['end']):
            uniEncoded += '\\U'+(fillFix(str(hex(item))[2:]))
            
    #print(uniEncoded+'****')
    uniDecoded = uniEncoded.encode().decode("unicode-escape")
    print(uniDecoded)



